import { StyleSheet } from "react-native";

const styles = StyleSheet.create({

  layout: {
    justifyContent: "center",
    flex: 1,
  },
  textInput: {
    width: "90%",
    marginLeft: 10,
    marginRight: 10,
    marginBottom: 30,
    borderColor: "red",
    borderBottomWidth: 2,
    fontSize: 16,
  },
});

const buttons = StyleSheet.create({
  button1: {
    elevation: 8,
    backgroundColor: "#ffa600",
    marginRight: 50,
    marginLeft: 50,
    marginBottom: 5,
    borderRadius: 10,
    paddingVertical: 20,
    paddingHorizontal: 20,
  },
  buttontext:{
    textAlign: "center",
    color: "white",
    fontSize: 20,
    fontWeight: "bold",
  }


});

export {styles, buttons};
